  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of the Recovery Plan
  is to restore the Delmarva fox squirrel to secure status throughout its former range.
  The plan includes the following actions to attain this objective: 1) Maintenance
  of existing occupied habitat; 2) Translocation of squirrels into suitable designated
  (historic) environments from which they are absent; 3) Protection of squirrel populations
  through law enforcement; and 4) Promotion of public support and understanding.\",\n\t\"owner_org\":
